import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { EventCardComponent } from './components/event-card/event-card.component';
import { ArtistCardComponent } from './components/artist-card/artist-card.component';
import { MapInteractiveComponent } from './components/map-interactive/map-interactive.component';
import { TestimonialSliderComponent } from './components/testimonial-slider/testimonial-slider.component';
import { PartnerCardComponent } from './components/partner-card/partner-card.component';
import { MediaCardComponent } from './components/media-card/media-card.component';
import { ContactFormComponent } from './components/contact-form/contact-form.component';
import { AccueilComponent } from './pages/accueil/accueil.component'; // Correction ici

const routes: Routes = [
  { path: 'accueil', component: AccueilComponent }, // Ajout de la bonne route
  { path: 'events', component: EventCardComponent },
  { path: 'artists', component: ArtistCardComponent },
  { path: 'map', component: MapInteractiveComponent },
  { path: 'testimonials', component: TestimonialSliderComponent },
  { path: 'partners', component: PartnerCardComponent },
  { path: 'media', component: MediaCardComponent },
  { path: 'contact', component: ContactFormComponent },
  { path: '', redirectTo: '/accueil', pathMatch: 'full' }, // page d'accueil par défaut
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
